
import React, { useState } from 'react';

interface LoginProps {
  onLogin: () => void;
}

type LoginView = 'login' | 'forgot' | 'request';

const Login: React.FC<LoginProps> = ({ onLogin }) => {
  const [view, setView] = useState<LoginView>('login');
  const [showPassword, setShowPassword] = useState(false);

  const renderLoginForm = () => (
    <div className="flex-1 px-8 pt-10 pb-12 flex flex-col text-center">
      <h2 className="text-2xl font-bold text-slate-800 mb-2">Bienvenido a UrbanaKey</h2>
      <p className="text-slate-500 mb-10">Gestiona tu hogar con seguridad y eficiencia.</p>

      <form className="space-y-6 text-left" onSubmit={(e) => { e.preventDefault(); onLogin(); }}>
        <div>
          <label className="block text-xs font-bold text-slate-500 uppercase tracking-wider mb-2 ml-1">Torre / Apartamento</label>
          <div className="relative">
            <span className="material-symbols-outlined absolute left-4 top-1/2 -translate-y-1/2 text-primary/70">apartment</span>
            <input 
              type="text" 
              placeholder="Ej: T2-402"
              className="w-full bg-gray-50 border-none rounded-xl py-4 pl-12 pr-4 focus:ring-2 focus:ring-primary/20 transition-all shadow-sm"
              required
            />
          </div>
        </div>

        <div>
          <label className="block text-xs font-bold text-slate-500 uppercase tracking-wider mb-2 ml-1">Contraseña</label>
          <div className="relative">
            <span className="material-symbols-outlined absolute left-4 top-1/2 -translate-y-1/2 text-primary/70">lock</span>
            <input 
              type={showPassword ? "text" : "password"} 
              placeholder="••••••••"
              className="w-full bg-gray-50 border-none rounded-xl py-4 pl-12 pr-12 focus:ring-2 focus:ring-primary/20 transition-all shadow-sm"
              required
            />
            <button 
              type="button" 
              onClick={() => setShowPassword(!showPassword)}
              className="absolute right-4 top-1/2 -translate-y-1/2 text-gray-400"
            >
              <span className="material-symbols-outlined">{showPassword ? 'visibility_off' : 'visibility'}</span>
            </button>
          </div>
        </div>

        <div className="flex justify-end">
          <button 
            type="button" 
            onClick={() => setView('forgot')}
            className="text-sm font-semibold text-primary"
          >
            ¿Olvidaste tu contraseña?
          </button>
        </div>

        <button 
          type="submit"
          className="w-full bg-primary hover:bg-primary-dark text-white font-bold py-4 rounded-xl shadow-lg shadow-primary/20 active:scale-[0.98] transition-all flex items-center justify-center gap-2 mt-4"
        >
          INGRESAR
          <span className="material-symbols-outlined">arrow_forward</span>
        </button>
      </form>

      <div className="mt-8 flex flex-col items-center gap-6">
        <button className="flex items-center gap-2 text-slate-400 font-medium">
          <span className="material-symbols-outlined">face</span>
          Ingresar con Face ID
        </button>
        
        <div className="w-full border-t border-gray-100 pt-6">
          <p className="text-sm text-slate-400 mb-2">¿Nuevo aquí?</p>
          <button 
            onClick={() => setView('request')}
            className="text-primary font-bold"
          >
            Solicitar acceso al administrador
          </button>
        </div>
      </div>
    </div>
  );

  const renderForgotView = () => (
    <div className="flex-1 px-8 pt-10 pb-12 flex flex-col">
      <button onClick={() => setView('login')} className="flex items-center text-primary font-bold gap-1 mb-8">
        <span className="material-symbols-outlined">arrow_back</span>
        Volver
      </button>
      <h2 className="text-2xl font-bold text-slate-800 mb-4">Recuperar Contraseña</h2>
      <p className="text-slate-500 mb-8">Ingresa el correo electrónico asociado a tu apartamento para recibir instrucciones.</p>
      
      <div className="space-y-6">
        <div>
          <label className="block text-xs font-bold text-slate-500 uppercase mb-2 ml-1">Correo electrónico</label>
          <input 
            type="email" 
            placeholder="correo@ejemplo.com"
            className="w-full bg-gray-50 border-none rounded-xl py-4 px-4 focus:ring-2 focus:ring-primary/20 shadow-sm"
          />
        </div>
        <button 
          className="w-full bg-primary text-white font-bold py-4 rounded-xl shadow-lg"
          onClick={() => { alert("Correo enviado"); setView('login'); }}
        >
          ENVIAR INSTRUCCIONES
        </button>
      </div>
    </div>
  );

  const renderRequestView = () => (
    <div className="flex-1 px-8 pt-10 pb-12 flex flex-col">
      <button onClick={() => setView('login')} className="flex items-center text-primary font-bold gap-1 mb-8">
        <span className="material-symbols-outlined">arrow_back</span>
        Volver
      </button>
      <h2 className="text-2xl font-bold text-slate-800 mb-4">Solicitar Acceso</h2>
      <p className="text-slate-500 mb-8">Completa tus datos para que el administrador verifique tu identidad.</p>
      
      <form className="space-y-4" onSubmit={(e) => { e.preventDefault(); alert("Solicitud enviada"); setView('login'); }}>
        <input type="text" placeholder="Nombre completo" className="w-full bg-gray-50 border-none rounded-xl py-3 px-4 shadow-sm" required />
        <input type="text" placeholder="Torre y Apartamento" className="w-full bg-gray-50 border-none rounded-xl py-3 px-4 shadow-sm" required />
        <input type="tel" placeholder="Teléfono" className="w-full bg-gray-50 border-none rounded-xl py-3 px-4 shadow-sm" required />
        <textarea placeholder="Mensaje adicional" className="w-full bg-gray-50 border-none rounded-xl py-3 px-4 shadow-sm h-24" />
        <button className="w-full bg-primary text-white font-bold py-4 rounded-xl shadow-lg mt-4">
          SOLICITAR ACCESO
        </button>
      </form>
    </div>
  );

  return (
    <div className="flex-1 flex flex-col bg-white">
      <div className="relative w-full aspect-[4/3] rounded-b-[2.5rem] overflow-hidden shadow-lg shrink-0">
        <div className="absolute inset-0 bg-gradient-to-t from-black/60 to-transparent z-10"></div>
        {/* Usamos el logo proporcionado */}
        <img 
          src="data:image/png;base64," 
          alt="UrbanaKey Logo" 
          className="w-full h-full object-cover"
          onError={(e) => {
            // Fallback en caso de que logo.png no esté disponible localmente aún
            (e.target as HTMLImageElement).src = "https://picsum.photos/id/122/800/600";
          }}
        />
        <div className="absolute inset-0 z-20 flex flex-col items-center justify-end pb-8">
          <div className="w-20 h-20 bg-white rounded-3xl flex items-center justify-center shadow-xl mb-4 overflow-hidden p-3">
             <img src="data:image/png;base64," alt="UrbanaKey" className="w-full h-full object-contain" />
          </div>
          <h1 className="text-3xl font-bold text-white tracking-tight">UrbanaKey</h1>
        </div>
      </div>

      {view === 'login' && renderLoginForm()}
      {view === 'forgot' && renderForgotView()}
      {view === 'request' && renderRequestView()}
    </div>
  );
};

export default Login;
